// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import app from './app';
import reportWebVitals from './reportWebVitals'; // Optional for performance monitoring

ReactDOM.render(
  <React.StrictMode>
    <App />  {/* This is where App.js is rendered */}
  </React.StrictMode>,
  document.getElementById('root')  // This matches the id in index.html
);

reportWebVitals();  // Optional for performance monitoring
